import matplotlib.pyplot as plt
import numpy as np
import math as m


def gantt(messageNotation, messageRepeat, messageLength, messageOffset, linkNotation):
    for i in range(len(messageNotation)):
        plt.barh(linkNotation[i], messageLength[i], left=messageOffset[i], facecolor=colorBuf[messageNotation[i] % 10])
        #plt.text(messageOffset[i] + messageLength[i] / 16, linkNotation[i] - 0.2,
                 #'J%s.%s' % (messageNotation[i], messageRepeat[i]), color="black", size=8)

def gantt_rect(messageNotation, messageRepeat, messageLength, messageOffset, linkNotation):
    for i in range(len(messageNotation)):
        if messageNotation[i] == 1:
            rect = plt.Rectangle(
                (messageOffset[i], linkNotation[i]-0.5),  # (x,y)矩形左下角
                messageLength[i],  # width长
                1,  # height宽
                facecolor = colorBuf[messageNotation[i] % 10],
                edgecolor = colorBuf[messageNotation[i] % 10],
                alpha = 1,
                linewidth = 1)
            ax.add_patch(rect)

def gantt_broken(messageNotation, messageRepeat, messageLength, messageOffset, linkNotation):
    for i in range(len(messageNotation)):
        ax.broken_barh([(messageOffset[i], messageLength[i])],
                       (linkNotation[i], 1), facecolor=colorBuf[messageNotation[i] % 10])

